import styled from 'styled-components';
import theme from '../../../theme/theme';

const HeaderStyled = styled.header`

  div.menu {
    span.squares-menu {
      div.square {
        height: 15px;
        width: 15px;
        border: 5px solid ${theme.colors.orange};
        border-radius: 10px;
      }
    }
  }
`;

export default HeaderStyled;
